import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div style={{height:'400px', position:'relative'}}>
        <Layout style={{background:'image/syenny.jpg'}}>
        </Layout>
      </div>
    );
  }
}

export default App;
